INSERT INTO `suit_types` (`id`, `name`, `detail`, `created_at`, `updated_at`) VALUES
(1, 'Toxedo Suits/ Smoking Suits', 'Texido Suit or smoking suit is mostly wear in Wedding party special function and other VIP party.\r\nTexido suit is different style coz of its Jacket Lepel round cutting from shoulder to waist.\r\nOn the round Jacket lepel using Shinning Black or whiting color makes Jacket is VIP.\r\nTexido pant is also quite different from other Pant also using of Shinning Fabric from side pocket to till down bottom about one inoh wide stiching\r\nTexido shirt is the stiching by a lots of small layer at the cheast and shirt bottom is hidden.', '2019-03-01 21:09:50', '2019-03-10 00:39:07'),
(2, 'Double Breasted Suits', 'Double breast Jacket is also look style.\r\nWhich have 6 to 8 bottom.\r\nNow atime using Cheak color is pupular.\r\nDouble brest which have Importen bottom or hiddle bottom is Inside.', '2019-03-01 21:11:19', '2019-03-10 00:39:28'),
(3, 'Chinese Suits', 'Chainese Suit is also much demand.By design of Chinese traditional dragon paint at Jacket with neck around color.\r\nChainese Vestcoat is similary with other normal.\r\nVetcoat But Chainese Vetcoat use more bottom and a little longer.\r\nIndian Vestcoat which is call modi coat is famous now.Coz it using alittle shinning color at pocket size and shinning boottom using', '2019-03-01 21:11:23', '2019-03-10 00:48:53'),
(4, 'Formal Suits/ Casual Suits', 'Formal Suit is the most using Suit all around the world.\r\nFormal Suit which makes 1,2,3 bottoms on Jacket 3 bottom Jacket is quity old style and not much use now atime because in 3 bottom lepel become so small feels tightly at cheast  thats why.Z bottom jacket is much demend now atime.Coz in two bottom lepel look so nice and feels comfortable on Cheast.\r\nIf Someone high is nomal one or two bottom is best.\r\nI bottom also use in youth coz someone like long lepel then one bottom is best.If someone like little lose then one open', '2019-03-01 21:11:30', '2019-03-15 05:06:46');
